import React from 'react'


export default props => {

    return (
        <div className="Insert">
            <form>
                <p><input type="text" name="title" placeholder="Title" onChange={props.storeChanges}/></p>
                <p><input type="text" name="owner" placeholder="Owner" onChange={props.storeChanges}/></p>
                <p><textarea type="text" name="body" placeholder="Body" onChange={props.storeChanges}/></p>
            </form>
        </div>
    )

}
